  "text" : "\uBA74\uBAA9\uB3D9 \uC591\uC544\uCE58\uB4E4\uC774 \uBAA8\uC5EC \uB5A0\uB4DC\uB294 \uC624\uB298\uC758 \uD654\uB450\uB294 \uCE58\uC988\uB2E4. \uC544\uC774\uC5D0\uAC8C \uCE58\uC988\uB97C \uBA39\uACE0 \uC2F6\uC740 \uB9CC\uD07C \uBA39\uC774\uB824\uBA74 \uB3C8\uC744 \uB9CE\uC774 \uBC8C\uC5B4\uC57C \uD55C\uB2E4\uB294 \uC2EC\uD50C\uD55C \uACB0\uB860. 10\uC7A5\uC5D0 5\uCC9C\uC6D0\uC778 \uC0C1\uD558\uCE58\uC988 \uB9E4\uC77C \uBA39\uC774\uAE30. \uC0BC\uC131\uC804\uC790 \uB2E4\uB2C8\uB294 \uB188\uB3C4, \uB9C9\uB178\uB3D9 \uD558\uB294 \uB188\uB3C4 \uAC19\uC740 \uACB0\uB860. \uC0CC\uB2D8\uC778 \uB098\uB9CC \uBAA8\uB978\uB2E4.",
