  "text" : "\uC124\uB4DD\uACFC \uB17C\uB9AC\uC801 \uBCC0\uB860\uACFC, \uAD8C\uC704\uC640 \uB300\uC758\uBA85\uBD84\uC5D0 \uB530\uB978 \uBE44\uD310\uC744 \uD1B5\uD574\uC11C \uC6C0\uC9C1\uC77C \uC218 \uC788\uB294 \uC14B\uD305\uC774 \uC788\uB2E4. \uD558\uC9C0\uB9CC 30\uB144\uC9C0\uAE30 \uC0AC\uC774\uC5D0 \uADF8\uB7F0 \uAC74 '\uAC1C\uCF54'\uB2E4. \"\uC9C0\uB784\uD558\uACE0 \uC790\uBE60\uC84C\uB124\"\uAC00 \uB09C\uBB34\uD558\uB294\uB370 \uB204\uAC00 \uC633\uB2E4\uACE0 \uB9DE\uB294 \uAC74 \uC5C6\uB2E4. \uD3ED\uB825\uC801\uC774\uACE0 \uB9C8\uCD08\uC801\uC774\uC9C0\uB9CC \uB09C \uC774 \uAD00\uACC4\uB3C4 \uC774\uD574\uD55C\uB2E4.",
